	 (110,'Irish Spring Mens Body Wash  Body Wash for Men  All Skin Types  Original Scent  30 fl oz Bottle','https://i5.walmartimages.com/asr/c0d8d7cf-f793-4fd8-8583-202181be050a.fa065f44a5661bb1cba3f7886e68cd02.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff','Start your day with the invigorating clean of Irish Spring Original Body and Face Wash for Men  designed to provide 24 hours of long-lasting freshness. Infused with a cool  outdoor-fresh scent  it brings the essence of nature to every wash  so you are ready to take on the day. It?s also paraben free and formulated without phthalates. Our body wash for men is specially crafted to retain your skin?s natural moisture. Designed for use on both the face and body  it simplifies your daily routine while delivering the same refreshing experience you expect from Irish Spring. Irish Spring has a new cap with leak-proof design ensuring you stay fresh no matter where your journey takes you. Suitable for all ages and all skin types.',NULL,'Irish Spring','035000993984','Green','83278026','Health & Beauty > Personal Care > Cosmetics > Skin Care','',6.360,10.090,NULL,NULL,'2025-03-05 00:47:40.336009-06','2025-03-05 00:47:40.336009-06');
