	 (144,'Soap & Glory Clean on Me Clarifying Mandarin, Strawberry, Rose, Peach and Musk Body Wash - Original Pink Scent - 16.9 fl oz','https://pics.walgreens.com/prodimg/644946/450.jpg','When it comes to the function of Soap & Glory Clean on Me? Clarifying Body Wash, the clue is in the name. Clean on Me? shower gel body wash has a 2-in-1 formula that delivers a luxurious lather with built-in body lotion for skin that feels clean, soft, and ultra-hydrated. With 100 washes per bottle, you can enjoy refreshed and nourished skin again and again. Your skin will love the rich creamy texture of the built-in shower lotion and your senses will delight in the cult-classic Original Pink? fragrance with notes of rose, jasmine and violet as well as rich bergamot. *In a post application survey of n=50 sample, 82-97% agreed with this statement',NULL,'Soap & Glory','5045098964549','','5045098964549','Health & Beauty > Personal Care','1.38',5.990,11.000,NULL,NULL,'2025-03-05 01:02:47.146119-06','2025-03-05 01:02:47.146119-06'),
	 (145,'Skintimate Raspberry Rain Shave Gel for Women  Moisturizing Shaving Cream  7 oz','https://pics.walgreens.com/prodimg/45767/450.jpg','Skintimate? Raspberry Rain? Women?s Shave Gel combines the refreshing fragrance of fresh raspberries with Vitamin E and Olive Butter for a luxuriously smooth shave. Get ready for one berry smooth shave. Skintimate Raspberry Rain Women s Shave Gel does more than just smell great - 6 moisturizers help replenish your skin s natural moisture and deliver unbeatable razor protection for a comfortable  more touchable shave. The Unique formula contains vitamin E and olive butter with a refreshing fragrance of fresh raspberries. Skintimate Women s Shave Gel foams into a rich creamy lather and allows the razor to glide easily over skin offering unbeatable razor protection for a close  comfortable shave and healthy feeling  smooth skin. Skintimate Signature Scents Raspberry Rain Women s Shave Gel  7 Oz:',NULL,'Skinitmate','841058005490','Gold','841058005490','Health & Beauty > Personal Care > Cosmetics > Skin Care > Lotion & Moisturizer','4.1 Pounds',0.000,177.950,NULL,NULL,'2025-03-05 01:02:52.794061-06','2025-03-05 01:02:52.794061-06'),
	 (146,'Neutrogena Hydro Boost Gel Facial Cleanser - Fragrance Free - 16 fl oz','https://pics.walgreens.com/prodimg/651824/450.jpg','Looking for a face cleanser that gently and thoroughly cleanses while providing hydration? Try Neutrogena Hydro Boost Fragrance Free Hydrating Gel Facial Cleanser. This foaming facial cleanser from a dermatologist-recommended brand is perfect for dry, sensitive, and acne-prone skin. It transforms into a silky foaming lather that removes dirt, oil, makeup & impurities while leaving skin soft & supple. With Barrier Care Technology and hyaluronic acid, a natural skin hydrator, this gentle face wash respects your skin''s moisture barrier and boosts hydration levels. The lightweight formula is hypoallergenic, non-comedogenic, and free of fragrance, soaps, parabens, phthalates, and alcohol. It''s a great addition to your skin care routine and lathers easily, rinsing clean. For even more hydration, pair with other products in Neutrogena''s Hydro Boost line. Try it today for glowing, hydrated skin!',NULL,'Neutrogena','070501064320','Other','85895958','','1.25',12.880,23.990,NULL,NULL,'2025-03-05 01:03:01.216415-06','2025-03-05 01:03:01.216415-06'),
	 (147,'Duke Cannon Supply Co. Heavy Grit Deep Cleaning Brick of Soap for Men - 6oz','https://target.scene7.com/is/image/Target/GUEST_884cf861-dc24-4927-8389-faf284d042bb?wid=1000&hei=1000','Whether toiling in a repair shop with no A/C or troubleshooting a septic tank, Duke Cannon requires three things when the job is done: an ice-cold adult beverage, a powerful showerhead, and a heavy-duty bar of soap loaded with scrubbing grit for a deep clean he can feel. This specialized body soap bar muscles right through caked-on grime and grease and fortifies skin with rich moisturizers and vitamins to leave even the hardest-working hides feeling soft, clean, and fully refreshed.',NULL,'Duke Cannon Supply Co.','371782004020','','92612640','','',4.890,7.990,NULL,NULL,'2025-03-05 01:03:21.791824-06','2025-03-05 01:03:21.791824-06'),
	 (148,'Duke Cannon Supply Co. Soft Side Hydrating Brick of Soap for Men - 6oz','https://target.scene7.com/is/image/Target/GUEST_686a7431-4152-4926-a6ad-e08d835804b2?wid=1000&hei=1000','As a man who works long hours in harsh environments, Duke Cannon''s skin takes a beating. So it stands to reason that at the end of his shift, his chapped hide requires a specialized solution: a hydrating soap bar that removes grime without making him feel like shoe leather. This superior-grade, buttery-smooth bar of soap is loaded with moisturizers and vitamins, delivers a rich lather, and rinses clean to leave irritation-prone skin feeling comfortable and refreshed.',NULL,'Duke Cannon Supply Co.','371782004013','','92612624','','',7.990,7.990,NULL,NULL,'2025-03-05 01:03:26.369778-06','2025-03-05 01:03:26.369778-06'),
	 (149,'Duke Cannon Big Bourbon Beard Oil - Bourbon Oak Barrel Scent - Beard Oil for Men - Trial Size - 3 fl. oz','https://covers.booksamillion.com/covers/gift/8/50/300/008/850300008936-1.jpg','The decision to cultivate a world champion beard can never be taken lightly. A firm commitment to proper care and maintenance is a must. Do what needs to be done and equip yourself with Duke Cannon''s Big Bourbon Beard Oil. Made with premium natural ingredients such as apricot kernel, argan, and jojoba oils, it''s formulated to soften even the hardest working beards. We even threw in a hint of Buffalo Trace Bourbon in there, because bourbon makes everything better. It doesn''t smell like you''ve had one too many; it has a woodsy, oak barrel scent that most folks find very appealing.',NULL,'Duke Cannon Supply Co.','850300008936','Grey Pinstripe','03BDOIL1','Home & Garden > Decor > Home Fragrances > Fragrance Oil','0.00 lb',9.990,118.980,NULL,NULL,'2025-03-05 01:03:39.860504-06','2025-03-05 01:03:39.860504-06');
